import React from 'react';
import image1 from "./image1/image1.png";

export default function Image1() {
    return (
        <div
            style={{
                borderRadius: "3px",
                height: "130px",
                width: "130px",
                boxShadow: "3px 3px 3px #b4beb7"
            }}
        >
            <img src={image1} width="130px" alt="" style={{
                borderRadius: "3px"
            }} />
        </div>
    )
}
